import React, { useState } from "react";

function Darbai({
  klase = "d-flex align-items-center justify-content-between",
  stilius = {},
  darbai = ["darbas1.png", "darbas2.jpg", "darbas3.png, darbas4.png"],
  darbo_dydis = 100,
}) {
  const [currentIndex, setCurrentIndex] = useState(0); // Track current image index

  const handleNext = () => {
    setCurrentIndex((prevIndex) => (prevIndex + 1) % darbai.length); // Next image
  };

  const handlePrev = () => {
    setCurrentIndex((prevIndex) =>
      prevIndex === 0 ? darbai.length - 1 : prevIndex - 1
    );
  };

  return (
    <>
      <p>Mano darbai</p>
      <div className={klase} style={stilius}>
        <button onClick={handlePrev}>Previous</button>
        <img
          src={require("../images/" + darbai[currentIndex])}
          alt="Darbas"
          width={logo_plotis}
          height={logo_plotis}
        />
        <button onClick={handleNext}>Next</button>
      </div>
    </>
  );
}

export default Darbai;
